<script type=""text/javascript"">
    function d() {
        var sta = ""2021/01/15 00:00:00 "";
        var currentTime = new Date();
        var startDate = new Date(sta)

        var dif = startDate - currentTime;
        var s = 1000;
        var m = 1000 * 60;
        var h = 1000 * 60 * 60;
        var d = 1000 * 60 * 60 * 24;

        var days = Math.floor(dif / d);
        dif -= days * d;
        if (dif <= 0) dif = 0;

        var hours = Math.floor(dif / h);
        dif -= hours * h;
        if (dif <= 0) dif = 0;

        var minutes = Math.floor(dif / m);
        dif -= minutes * m;
        if (dif <= 0) dif = 0;

        var seconds = Math.floor(dif / s);
        document.getElementById('d').innerHTML = ""    مانده روز:&nbsp;&nbsp;"" + days + ""&nbsp;&nbsp;  مانده  ساعت:&nbsp;&nbsp;"" + hours + ""  &nbsp;&nbsp; مانده دقیقه:&nbsp;&nbsp;"" + minutes + ""  &nbsp;&nbsp;  مانده ثانیه:&nbsp;&nbsp;"" + seconds;
    }
    setInterval(""d()"", 1000);
</script>");
